import styled from "styled-components"

export const Paginacion = ({ pagina, setPagina, maximo }) => {
   return (
      <div className={styled.container}>
         <button className={styled.atras}> atras </button>
         <input />
         <p> de {maximo} </p>
         <button className={styled.adelante}> adelante </button>
      </div>
   )
}
